pragma solidity ^0.8.0;

interface IAmaSession {

    function setBaseURI(string memory _baseURI) external;
    function totalSessions(address owner_) external view  returns(uint256);
    function sessionIdAtIndex(address owner_, uint256 index_) external view returns(bytes32);

    function getSessionRewardPerAMA(bytes32 sessionId_)
        external
        view
        returns (uint256);

    function isAnySessionLive(address owner_)
        external
        view
        returns (bytes32);

    function sessionRewardPerAma(bytes32 sessionId_) 
        external 
        view 
        returns (uint256);

    function updateSessionLink(address owner_,
                                bytes32 sessionId_,
                                string memory newLink_) external;

    function topUpSession(address owner_,
                            bytes32 sessionId_,
                            uint256 additionalFund) external;

    function extendSession(
                        address owner_,
                        bytes32 sessionId_,
                        uint256 additionalTime) external;

    function deductRewardOnReply(address owner_,
                                bytes32 sessionId_,
                                bytes32 messageId_) external;

    function endSession(
                        address owner_,
                        bytes32 sessionId_) external;

    function claimRewardLeft(
                        address owner_,
                        bytes32 sessionId_) external returns(uint256);

    function createSession(address owner_,
                            uint256 startTime_,
                            uint256 endTime_,
                            uint256 rewardPerAMA_,
                            uint256 rewardPool_,
                            string memory sessionLink_
                    )
                external
                payable
                returns (bytes32);

}
